    "2016-04-06T23:20:03.064642",nt"name": "premarket-approvals-pma",nt"isopen":
    true,nt"url": null,nt"notes": "<p>Premarket approval by FDA is the required
    process of scientific review to ensure the safety and effectiveness of all devices
    classified as Class III devices. An approved Premarket Approval Application (PMA)
    is, in effect, a private license granted to the applicant for marketing a particular
    medical device. This database may be searched by a variety of fields and is updated
    on a monthly basis.</p>n",nt"license_title": "Other License Specified",nt"extras":
